import React from 'react';

import { NavToProdBtn } from '../components';

import napkinsImg from '../assets/napkins.webp';
import toiletsImg from '../assets/toilets.webp';

export const HomePage = () => {
	return (
		<section>
			<h1>HOME PAGE</h1>
      <NavToProdBtn link='/' imgSrc=''/>
      <NavToProdBtn link='/production' imgSrc={napkinsImg} />
      <NavToProdBtn link='/production' imgSrc={toiletsImg} />
		</section>
	);
}
